                <p xmlns="http://www.w3.org/1999/xhtml"><p style="color:#6EB5CBff">
                    (From: https://en.wikipedia.org/wiki/ Pacitan_Regency)</p>
                    <p style="color:#6EB5CBff">Pacitan Regency (Indonesian: Kabupaten Pacitan) is a regency located in the southwestern corner of East Java Province,
                    with Central Java Province on its western border.
                    Located between 7.55째 - 8.17째S and 110.55째 - 111.25째E.
                    The borders of Pacitan Regency are: Wonogiri Regency (Central Java) in the west, Ponorogo Regency and Wonogiri Regency in the north,
                    Trenggalek Regency in the east, and Indian Ocean in the south. </p></p>
                    <p style="color:#1D333Eff">
                    The capital of Pacitan Regency is Pacitan town. The majority of citizens in Pacitan speak Javanese as their first language, while speaking Indonesian as a second language.</p>
            </foreignObject>

            <foreignObject x=970 y=470 width="200" height="600" font-size="12" font-family="Arial,sans-serif" text-anchor="middle"
                requiredFeatures="http://www.w3.org/TR/SVG11/feature#Extensibility">
                <p xmlns="http://www.w3.org/1999/xhtml">
                    <p style="color:#6EB5CBff">
                        &#128160; The whole page with SVG rectangles as the grid layout. 
                        I also used layering with z index and positioning with absolute etc.
                    </p>
                    <p style="color:#6EB5CBff">
                        &#128160; The animation as the header (works well in chrome). 
                        All the ellipse shape move in the certain time frame.
                    </p>
                    <p style="color:#6EB5CBff">
                        &#128160; The hover over each SVG element as the grid.
                        So, everytime you move your mouse, it will show which grid you are on.
                    </p>
                    <p style="color:#1D333Eff">
                        &#128160; The gradient effect for the main body of the page.
                    </p>
                    <p style="color:#1D333Eff">
                        &#128160; The hover over each name of district on the map showing the estimated population of the chosen district.
                        It uses the class from the map.
                    </p>
                    <p style="color:#1D333Eff">
                        &#128160; The blur effect on the map. This effect applied on both maps. 
                        The maps are exported from ArcGIS Pro and converted to Optimized SVG in Inkscape.
                    </p>
                    <p style="color:#1D333Eff">
                        &#128160; The marker on the map has 'active' effect. 
                        So, when you click the marker it will show you the place of Pacitan as city center on the smaller scale map.
                    </p>
                </p>
